import classes from './RecomendCard.module.sass'
import picture from '../../../images/png/rukzak.png'

const RecomendCard = () => {

    return (
    <div className={classes.recomendCard}>
        <img/>
        <img className={classes.mainPicture} src={picture}/>
        <img/>
    </div>
    )

}

export default RecomendCard
